import React from "react";
import { Menu, Input } from "antd";
const AppLayout = ({ children }) => {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item key={"edoc"}>전자문서</Menu.Item>
        <Menu.Item key={"ntc"}>공지사항</Menu.Item>
      </Menu>
      {children}
    </div>
  );
};

export default AppLayout;
